def normal_dict():
  b = random_dict
  b['key'] = 'val'
  b['key_two'] = 'val_two'
  b['key_three'] = 'val_three'
  b['key']
  b['key_three']
  b['key']
  return b

def copy_deepcopy():
  a = copy.deepcopy(random_dict)
  a['key'] = 'val'
  a['key_two'] = 'val_two'
  a['key_three'] = 'val_three'
  a['key']
  a['key_three']
  a['key']
  return a

def json_deepcopy():
  a = json.loads(json.dumps(random_dict))
  a['key'] = 'val'
  a['key_two'] = 'val_two'
  a['key_three'] = 'val_three'
  a['key']
  a['key_three']
  a['key']
  return a

def ujson_deepcopy():
  a = ujson.loads(ujson.dumps(random_dict))
  a['key'] = 'val'
  a['key_two'] = 'val_two'
  a['key_three'] = 'val_three'
  a['key']
  a['key_three']
  a['key']
  return a

def immutable_Map(Maparg):
  b = Maparg.set('key', 'val').set('key_two', 'val_two').set('key_three', 'val_three')
  b['key']
  b['key_three']
  b['key']
  return b


if __name__ == '__main__':
  import timeit
  print('normal:       ', end='')
  print(timeit.timeit(
    'normal_dict()',
    setup="import copy; from __main__ import random_dict, normal_dict",
    number=100000)
  )

  print('deepcopy:       ', end='')
  print(timeit.timeit(
    'copy_deepcopy()',
    setup="import copy; from __main__ import random_dict, copy_deepcopy",
    number=1000)
  )

  print('json_deepcopy:  ', end='')
  print(timeit.timeit(
    'json_deepcopy()',
    setup="import json; from __main__ import random_dict, json_deepcopy",
    number=1000)
  )

  print('ujson_deepcopy: ', end='')
  print(timeit.timeit(
    'ujson_deepcopy()',
    setup="import ujson; from __main__ import random_dict, ujson_deepcopy",
    number=1000)
  )

  print('immutable Map:  ', end='')
  print(timeit.timeit(
    'immutable_Map(maparg)',
    setup="from __main__ import random_dict, immutable_Map; from immutables import Map; maparg = Map(random_dict)",
    number=100000)
  )
